            if index == len(string):
                return True

            for production in grammar:
                if production == string:
                    return True

                if production.startswith("NT"):

                    next_string = current_string + production[len(production):]
                    if backtrack(index + len(production), next_string):
                        return True

            return False

        return backtrack(0, "")

    if generate_string(s, s):
        print("Yes")
    else:
        print("No")

solve()
